import React, { Component } from 'react';
import '../App.css';

class Sidescreen extends Component {

    render() {
        const { filteredVenues, filterVenues } = this.props;
        return (
          <div id="sidebar">
            <input placeholder="search" value={this.props.query} onChange={(e) => { filterVenues(e.target.value) }}/>
          <br/>

          {
            filteredVenues && filteredVenues.length > 0 &&
            filteredVenues.map((venue, index) => (
              <div key={index} className="venue-item" onClick={() => { this.props.listItemClick(venue) }}>
              {venue.name}
              </div>
          ))
          }

          </div>
        )
}
}
export default Sidescreen;
